import { Component } from 'react';
// import {Stack, Grid, Box, Typography} from '@mui/system/Stack';
import { Grid, Typography, Box } from '@mui/material';
import { makeStyles } from '@mui/styles';
import './App.css';
import { gsap, InertiaPlugin, Draggable, TextPlugin } from "gsap/all";

 const useStyles = makeStyles({
  btn: {
      fontFamily:  ["Monsieur La Doulaise", "cursive"].join(","),
      fontWeight: 400,
      fontStyle: "normal",
      fontSize: "4em",
      margin:"unset",
    }
});

class HomePage extends Component {
  componentDidMount() {
    gsap.registerPlugin(Draggable, InertiaPlugin, TextPlugin);

    Draggable.create(".draggable", {
      bounds: ".fullpage-container",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

    Draggable.create(".rotation", {
      type: "rotation",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

     gsap.to(".title-home", {
        duration: 3,
        text: "Jade & Seka",
        ease: "power1.out",
    });
  }

  render() {
    return (
      <div className="fullpage-container">
                <Grid
      container
      direction="column" // Stack items vertically
      justifyContent="center"
      alignItems="center"
      style={{ minHeight: '100vh' }} // Center vertically in viewport
    >
      {/* Top two images */}
            <Grid container direction="row" justifyContent="center" spacing={2}>
              <Grid item>
                <img className="draggable image-context" src={require('./sd_card.png')}  alt="sd card 1" />
              </Grid>
              <Grid item>
                <img className="draggable image-context" src={require('./cup.png')} alt="cup 2" />
              </Grid>
            </Grid>

            {/* Centered Text */}
            <Grid item>
              <Typography className="cedarville-cursive-regula" variant="h2" align="center">
                Jade & Seka
              </Typography>
            </Grid>

            {/* Bottom three images */}
            <Grid container direction="row" justifyContent="center" spacing={2}>
              <Grid item>
                <img className="draggable image-context" src={require('./champagne-glass.png')} alt="champagne 3" />
              </Grid>
              <Grid item>
                <img className="draggable image-context" src={require('./pinkflamingo.png')} alt="flamingo 4" />
              </Grid>
              <Grid item>
                <img className="draggable image-context" src={require('./Earth_icon_2.png')} alt="world 5" />
              </Grid>
            </Grid>
          </Grid>
              {/* <Stack direction="row" spacing={2} justifyContent="center" alignItems="center"> 
                  <img
                    src={require('./sd_card.png')} 
                    alt='sd_card' 
                    className="draggable image-context" 
                  />
               <img 
                src={require('./cup.png')} 
                alt='sd_card' 
                className="draggable image-context cup" 
                />
            <h2 style={{fontWeight:'bold', zIndex:4}} className="bebas-neue-regular title-home center-text"> </h2>   

            <img 
                src={require('./champagne-glass.png')} 
                alt='sd_card' 
                className="draggable image-context" 
            />
              </Stack> */}



      </div>
    );
  }
}


export default HomePage;
